import React from "react";
import { Link } from "react-router-dom";

const EVENTS = [
  { id: "p1", title: "p 1" },
  { id: "p2", title: "p 2" },
  { id: "p3", title: "p 3" },
  { id: "p4", title: "p 4" },
];

const Events = () => {
  return (
    <>
      <h1>Events</h1>
      <ul>
        {EVENTS.map((event) => (
          <li key={event.id}>
            <Link to={event.id}>{event.title}</Link>
          </li>
        ))}
      </ul>
    </>
  );
};

export default Events;
